import { ReturnStatement } from '@angular/compiler';
import { Component, OnInit } from '@angular/core';

@Component({
  selector: 'app-grid-board',
  templateUrl: './grid-board.component.html',
  styleUrls: ['./grid-board.component.css']
})
export class GridBoardComponent implements OnInit {

  constructor() { }
  width:number = 15;
  height:number = 15;
  items:number[][] = [];
  personRow = 0;
  personCol = 0;
  personDirection = 1;
  exitRow = 0;
  exitCol = 0;
  instructions:string = "F\nF\nR\nF\nF\nL\nF"
  instructionPtr: number = 0

  ngOnInit() {
    for (var i = 0; i < this.width; i++){
      this.items[i]=[]
      for (var j = 0; j < this.height; j++){
        this.items[i][j] = Math.round(Math.random()*10);
      }
    }
    this.exitRow = Math.round(Math.random()*(this.height-1));
    this.exitCol = Math.round(Math.random()*(this.width-1));
  }

  onReset() {
    this.instructionPtr = 0
    this.personCol = 0
    this.personRow = 0
    this.personDirection = 1
  }

  onStep() {
    var oldPersonDirection = this.personDirection;
    var oldPersonRow = this.personRow;
    var oldPersonCol = this.personCol;
    var instructionArr = this.instructions.split("\n", 100);
    var numInstr = instructionArr.length;
    if (this.instructionPtr>=numInstr)
      return;
    var cmd = instructionArr[this.instructionPtr]
    console.log(cmd)
    if ( cmd == "F"){
      switch (this.personDirection){
        case 0:
          this.personRow -= 1
          this.personRow = Math.max(0, this.personRow)
          break;
        case 1:
          this.personCol += 1
          this.personCol = Math.min(this.width-1, this.personCol)
          break;
        case 2:
          this.personRow += 1
          this.personRow = Math.min(this.height-1, this.personRow)
          break;
        case 3:
            this.personCol -= 1
            this.personCol = Math.max(0, this.personCol)
            break;
      }
    } if ( cmd == "B") {
      switch (this.personDirection){
        case 0:
          this.personRow += 1
          this.personRow = Math.min(this.height-1, this.personRow)
          break;
        case 1:
          this.personCol -= 1
          this.personCol = Math.max(0, this.personCol)
          break;
        case 2:
          this.personRow -= 1
          this.personRow = Math.max(0, this.personRow)
          break;
        case 3:
            this.personCol += 1
            this.personCol = Math.min(this.width, this.personCol)
            break;
      }
    }
    if ( cmd == "L")
      this.personDirection = this.personDirection>0?this.personDirection-1 : 3
    if ( cmd == "R")
      this.personDirection = this.personDirection<3?this.personDirection+1 : 0
    this.instructionPtr += 1
    console.log(this.instructions)
    if ( this.personRow == this.exitRow && this.personCol == this.exitCol ) {
      this.win()
      return false;
    } else if (this.items[this.personRow][this.personCol]>7){
      this.boop();
      this.personRow = oldPersonRow;
      this.personCol = oldPersonCol;
      this.personDirection = oldPersonDirection
      return false;
    } else {
      this.beep()
      return true;
    }
  }

  interval;
  onRun(){
    
      this.interval = setInterval(() => {
        if (!this.onStep())
          clearInterval(this.interval)
      },1000)
  
  }

  win(){
    console.log("Win!")
    var snd = new Audio("data:audio/wav;base64,")
    snd.play();
  }

  getTileColor(row, col){
    if ( row == this.personRow && col == this.personCol)
      return "#0000FF"
    else if ( row == this.exitRow && col == this.exitCol)
      return "#00FF00"
    else if ( this.items[row][col]>7 )
      return "#FF0000"
    else
      return "#666666"
  }
  getTileIcon(row, col){
    if ( row == this.personRow && col == this.personCol){
      if ( this.personDirection == 0)
        return "^"
      else if ( this.personDirection == 1)
        return ">"
      else if ( this.personDirection == 2)
        return "V"
      else
        return "<"
    } else if ( row == this.exitRow && col == this.exitCol)
      return "E"
  }

  boop() {
    var snd = new Audio("data:audio/mp3;base64,");  
    snd.play();
}

  beep() {
    var snd = new Audio("data:audio/wav;base64,");  
    snd.play();
}
}
